import './Weather_container.css';

function Weather_container() {
    const left_style = {
        position: 'relative',
        left: '-0px',
    };

    const forecastbutton_style = {
        position: 'relative',
        left: '50px',
    };

    const forecastbox_style = {
        position: 'relative',
        right: '20px',
        top: '2px',
    };

    const right_style = {
        position: 'relative',
        left: '300px',
        bottom: '-1px',
    };
    return (
        <div className="weather_container">
            <div className="left_field" style = {left_style}>
                <input type = "text" id = "textInput" placeholder= "1. Current City"></input>
                <button id = "button-73" role = "button">Search</button>
                <p>City: <span id="city"></span></p>
                <p>Time: <span id = "local_time" ></span></p>
                <p>Timezone: <span id = "timezone"></span></p>
                <i id = "weatherIcon" className=""></i>
                <p> <span id="degrees"></span> <span id="unit"></span></p>
                <p> <span id="degrees"></span> <span id="unit"></span></p>
                <p>Feels like: <span id = "feels_like"></span> <span id="unitf"></span></p>
                <p>Description: <span id = "description"></span></p>
                <p>UV Index: <span id = "uv"></span></p>
                <p>AQI Index: <span id = "aqi"></span></p>
                <br></br>
                <button id = "forecastButton" className="arrow-button" style={forecastbutton_style}>Forecast</button>
                <div id = "forecastBox" className= "forecast-box" style =  {forecastbox_style}>

                </div>



            </div>
            <div className="right_field" style ={right_style} >
                <input type = "text" id = "textInput1" placeholder='2. Destination city'>

                </input>
            </div>
        </div>
    );
}

export default Weather_container;
